import { BrowserRouter as Router, Route, Routes } from "react-router-dom";

//pages
import Home from "./pages/Home.jsx"
import About from "./pages/About.jsx"
import Article from "./pages/Article.jsx";
import ArticlesList from "./pages/ArticlesList.jsx";

import NotFound from "./pages/NotFound.jsx";

//components
import Navbar from "./components/Navbar.jsx";

// import './index.css'

export default function App() {
  return(

    <Router>
      <Navbar />
      <div className='max-w-screen-md mx-auto pt-20'>
        <Routes>
          <Route path='/' element={<Home />} />    




          <Route path='/about' element={<About />} />

          <Route path='/articles-list' element={<ArticlesList />} />



          <Route path='/article/:name' element={<Article />} />  
          {/* now we want if someone wants to open the page learn rect then they can simply open by using /article/learn-react then it should show us rticle on learning react */}
          {/* this is done by url parameters with react-router so suppose if we use id <Route path='/article/:id' element={<Article />} then in the Article.jsx file also we have to write id instaed of name />   so suppose we go to /article/learn-react then parameter name will be learn-react*/}

          <Route path='*' element={<NotFound />} />
        </Routes>
      </div>
    </Router>

  )
}
